css:
@syntax-cursor-color : #d5fdd5 // @ghost-white;
@keyframes bracket-animation {
  from {
    border-color: #ffffff;
  }
  40% {
    border-color: rgba(224, 253, 224, 0.615);
  }
  to {
    border-color: rgba(224, 253, 224, 0.45);
  }
}
atom-text-editor.editor .bracket-matcher .region {
  animation: bracket-animation 0.85s;
  border: 1px solid rgba(224, 253, 224, 0.45);
}
